// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract App {
    struct User {
        string f_name;
        string l_name;
        string password;
        address addr;
        bool isAdmin;
        bool isLoggedin;
    }

    struct Land {
        string lng;
        string lat;
        address owner;
    }

    struct Transaction {
        address from;
        address to;
        Land land;
    }

    Transaction[] transactions;
    Land[] public lands;
    mapping(address => User) user;

    function createLand(
        string memory lng,
        string memory lat,
        address owner
    ) public returns (bool) {
        Land memory land = Land(lng, lat, owner);
        lands.push(land);
        return true;
    }

    function login(address adr, string memory password) public returns (bool) {
        require(user[adr].addr != msg.sender);
        if (
            keccak256(abi.encodePacked((user[adr].password))) ==
            keccak256(abi.encodePacked((password)))
        ) // if ( keccak256() == keccak256(password)) {
        {
            user[adr].isLoggedin = true;
            return true;
        }
        return false;
    }

    function register(
        address _address,
        string memory f_name,
        string memory l_name,
        string memory password,
        bool isAdmin
    ) public returns (bool) {
        require(user[_address].addr != msg.sender);
        user[_address].addr = _address;
        user[_address].f_name = f_name;
        user[_address].l_name = l_name;
        user[_address].password = password;
        user[_address].isLoggedin = false;
        user[_address].isAdmin = isAdmin;
        return true;
    }
}
